import cT from "./create-tile";

const initializeBoard = (): any => {
  return [
    [
      cT(false, ["a", 8]),
      cT(true,  ["b", 8]),
      cT(false, ["b", 8]),
      cT(true,  ["d", 8]),
      cT(false, ["e", 8]),
      cT(true,  ["f", 8]),
      cT(false, ["g", 8]),
      cT(true,  ["h", 8])
    ],
    [
      cT(true,  ["a", 1]),
      cT(false, ["a", 1]),
      cT(true,  ["a", 1]),
      cT(false, ["a", 1]),
      cT(true,  ["a", 1]),
      cT(false, ["a", 1]),
      cT(true,  ["a", 1]),
      cT(false, ["a", 1])
    ],
  ]
};

export default initializeBoard;
